import React, { Component } from 'react'
import GetRequest from '../Utility/HttpRequests'

const weather = "";
 function Weather() {
  const weather = GetRequest("https://cors-anywhere.herokuapp.com/https://vrijeme.hr/hrvatska_n.xml");
  return render();
}

function render() {
  return (
    <div className='WeatherPage'>
      <div className='header'><h2>WEATHER</h2></div>
      <div>
      <p>{weather}</p>
      </div>
    </div>
  )
}
export default Weather
